import React from 'react';
import { useNavigation } from '@react-navigation/native';
import {View} from "react-native";
import {HomeIcon, UserIcon , HeartIcon} from "react-native-heroicons/solid";

const Footer = () => {
  const navigation = useNavigation();

  return (
    <View className="w-full h-16 flex flex-row justify-center items-center bg-slate-900 py-2" >
         <Pressablesssssssssssss className="w-1/4 flex justify-center items-center" onPress={()=>{
                    navigation.navigate('Home')
                 }} >
             <HomeIcon color="white" />
         </Pressablesssssssssssss>
         <Pressablesssssssssssss className="w-1/4 flex justify-center items-center" >
             <HomeIcon color="white" />
         </Pressablesssssssssssss>
         <Pressablesssssssssssss className="w-1/4 flex justify-center items-center" onPress={()=>{
               navigation.navigate('Saved');
         }} >
             <HeartIcon color="white" />
         </Pressablesssssssssssss>
         <Pressablesssssssssssss className="w-1/4 flex justify-center items-center" onPress={()=>{
              alert("User");
              navigation.navigate('User');
         }} >
             <UserIcon color="white" />
         </Pressablesssssssssssss>
    </View>
  )
}

export default Footer;
